import "firebase/firestore";

import * as React from "react";

import {
  Animated,
  Dimensions,
  ImageBackground,
  ScrollView,
  StyleSheet,
} from "react-native";
import { AntDesign, MaterialCommunityIcons } from "@expo/vector-icons";
import {
  Badge,
  Divider,
  HStack,
  Icon,
  IconButton,
  Image,
  StatusBar,
  Text,
  VStack,
} from "native-base";
import { SceneMap, TabView } from "react-native-tab-view";
import { connect, useSelector } from "react-redux";
import { useEffect, useState } from "react";

import { SafeAreaView } from "react-native-safe-area-context";
import { View } from "../components/Themed";
import firebase from "firebase";
import { getHistory } from "../services/firestore";
import { getUserDetails } from "../services/firestore";
import { logout } from "../services/auth";

const User = {
  name: "Robe Jobs",
  created: "2018-02-21",
  tags: ["programmer", "developer", "coder"],
  introduction:
    "Hello my friends :) I am Robe Jobs, would love to make some new friends while learning some languages! always find elderly like you interesting, as you have SO MUCH experiences and stories that I do not possess! Would always love to chat with you and know more about your lives ;)",
};

const SecondRoute = (state: any, props: any) => {
  const [userDetails, setUserDetails] = useState<any>(null);
  useEffect(() => {
    getUserDetails(state.user.uid, (val) => setUserDetails(val));
  }, []);
  return (
    <ScrollView>
      <VStack
        alignItems="center"
        width={Dimensions.get("window").width}
        height="100%"
        space={1}
        marginTop={3}
        paddingBottom={20}
      >
        <ImageBackground
          borderRadius={35}
          resizeMode="cover"
          source={require("../assets/images/robeJobs.jpg")}
          style={styles.rewards}
        ></ImageBackground>
        <Text fontSize={24} style={styles.bold}>
          {state.user.name}
        </Text>

        <View
          style={{
            width: "90%",
            borderRadius: 15,
            padding: 15,
            backgroundColor: "transparent",
          }}
        >
          <VStack>
            <Text style={{ ...styles.bold }}>About Me</Text>
          </VStack>
          <HStack alignItems="flex-start" marginTop={2}>
            {userDetails &&
              userDetails.interests.map((interest: any) => (
                <Badge
                  backgroundColor="transparent"
                  borderWidth={1}
                  borderColor="#172D55"
                  borderRadius={20}
                  paddingRight={5}
                  paddingLeft={5}
                  paddingTop={3}
                  paddingBottom={3}
                  marginRight={2}
                >
                  {interest}
                </Badge>
              ))}
          </HStack>
          <Text
            fontSize={13}
            py={2}
            marginTop={2}
            fontWeight="300"
            fontFamily="Avenir"
          >
            {userDetails && userDetails.bio && userDetails.bio != ""
              ? (userDetails.bio as string).split("\\n").map((x, index) => (
                  <Text>
                    {index == 0 ? "" : "\n"}
                    {x}
                  </Text>
                ))
              : "This user has no user information yet."}
          </Text>
          <Divider size={2} my={5} />
          <Text paddingBottom={5} style={{ ...styles.bold }}>
            Badges
          </Text>
          <HStack justifyContent="space-between">
            <Image
              source={require("../assets/images/medal_blue.png")}
              alt="medal_blue"
              style={{ width: 40, height: 40 }}
            />
            <Image
              source={require("../assets/images/medal_red.png")}
              alt="medal_red"
              style={{ width: 40, height: 40 }}
            />
            <Image
              source={require("../assets/images/medal_green.png")}
              alt="medal_green"
              style={{ width: 40, height: 40 }}
            />
            <Image
              source={require("../assets/images/medal_purple.png")}
              alt="medal_purple"
              style={{ width: 40, height: 40 }}
            />
            <Image
              source={require("../assets/images/medal_grey.png")}
              alt="medal_grey"
              style={{ width: 40, height: 40 }}
            />
          </HStack>
        </View>
      </VStack>
    </ScrollView>
  );
};

const mapStateToProps = (state: any, props: any) => {
  return { user: state.user };
};

const ProfileScreen = (props: any) => {
  const user = useSelector((state: any) => state.user);
  useEffect(() => {}, []);

  return (
    <SafeAreaView>
      <VStack
        alignItems="center"
        width={Dimensions.get("window").width}
        height="100%"
        marginTop={3}
      >
        <HStack style={styles.topBar}>
          <Text
            style={{
              fontSize: 24,
              color: props.user.isYouth ? "#FF7E41" : "#78C9A7",
              fontWeight: "500",
            }}
          >
            Profile
          </Text>
          <Icon
            size="sm"
            as={<AntDesign name="logout" />}
            color="black"
            onPress={() => logout()}
          />
        </HStack>
        <SecondRoute user={user}></SecondRoute>
      </VStack>
    </SafeAreaView>
  );
};

export default connect(mapStateToProps)(ProfileScreen);
const styles = StyleSheet.create({
  topBar: {
    justifyContent: "space-between",
    width: "80%",
  },
  rewards: {
    width: 125,
    height: 125,
  },
  bulletPoints: {
    color: "#438672",
    fontWeight: "500",
  },
  title: {
    fontWeight: "300",
    opacity: 0.89,
    marginTop: 15,
  },
  bold: {
    fontWeight: "bold",
  },
  info: {
    fontWeight: "bold",
    color: "#438672",
  },
});
